)

func ReverseDelete(s, c string) [2]interface{} {
	// Create a set of characters to delete for O(1) lookup
	deleteChars := make(map[rune]bool)
	for _, char := range c {
		deleteChars[char] = true
	}

	// Build the result string by excluding characters in c
	var result strings.Builder
	for _, char := range s {
		if !deleteChars[char] {
			result.WriteRune(char)
		}
	}

	resultStr := result.String()

	// Check if result string is a palindrome
	isPalindrome := true
	runes := []rune(resultStr)
	for i := 0; i < len(runes)/2; i++ {
		if runes[i] != runes[len(runes)-1-i] {
			isPalindrome = false
			break
		}
	}

	return [2]interface{}{resultStr, isPalindrome}
}

